import React from 'react';
import './Team.css';
import Nav from '../Content/BandeauHaut';
import Equipe from '../Content/Equipe';

import {Row} from 'react-bootstrap';
import {Col} from 'react-bootstrap';
import {Container} from 'react-bootstrap';

import Miami from '../images/LogoEquipe/Miami.png';

export default class Team extends React.Component {
    
    render() {
        const elements = [Miami, Miami, Miami, Miami, Miami, Miami];


        return(           
            <Container className="ballon" fluid>
                <Row>
                    <Nav/>
                </Row>
                
                <Row className="separer"></Row>
                <Row>
                    <Col xs={6}>
                        <Row>
                            {elements.map(item => {
                                return <Col xs={2}><Equipe photo={item}/></Col>
                            })}
                            {elements.map(item => {
                                return <Col xs={2}><Equipe photo={item}/></Col>
                            })}
                        </Row>
                        
                    </Col>
                    <Col xs={6}></Col>
                </Row>
                
                
            </Container>
        );
    }
}
